import React from 'react'
import "./Watch.scss"
import ArrowBackIosNewOutlinedIcon from '@mui/icons-material/ArrowBackIosNewOutlined';

export default function Watch() {
  return (
    <div className='Watch'>
        <div className="back">
            <ArrowBackIosNewOutlinedIcon />
            Home
        </div>
        <video className='video' autoplay progress controls src="https://www.koimoi.com/wp-content/new-galleries/2022/03/find-out-how-much-rrr-should-collect-to-be-a-hit-01.jp"></video>
    </div>
  )
}
